import React from 'react';
import { Divider, Flex, Box, Heading, Center,NativeBaseProvider,Text,Button,Input } from "native-base";

  
    const Tabs  = () => {

        return (
            <NativeBaseProvider>
                <Box alignItems="left" backgroundColor ="#ffff">
                    <Flex   direction="row">
        
                    <Button  mx="2" variant="link" colorScheme="grey">
                        Ingredientes
                    </Button>
        
                    <Button mx="2" variant="link" colorScheme="grey">
                        Plato
                    </Button> 
        
                    <Button mx="2" variant="link" colorScheme="grey">
                        Tipo
                    </Button> 
        
                     <Button mx="2" variant="link" colorScheme="grey">
                        Usuario
                    </Button> 
        
        
                    </Flex>
                
                </Box>

                <Box alignItems="center">
                    <Input mx="3" placeholder="Input" w="75%" maxWidth="300px" />
                    </Box>;

            </NativeBaseProvider>
          );
    };
        
        
export default Tabs
